import { getList } from "@/api/table";

export default {
  filters: {
    statusFilter(status) {
      const statusMap = {
        published: "success",
        draft: "gray",
        deleted: "danger"
      };
      return statusMap[status];
    }
  },
  data() {
    return {
      list: null,
      listLoading: true,
      form: {
        type: "",
        wangwang: "",
        shopname: ""
      },
      rules: {
        type: [{ required: true, trigger: "blur", message: "请选择店铺类型" }],
        wangwang: [
          { required: true, trigger: "blur", message: "请输入旺旺账号" }
        ],
        shopname: [
          { required: true, trigger: "blur", message: "请输入店铺账号" }
        ]
      }
    };
  },
  created() {
    this.fetchData();
  },
  methods: {
    submitForm(formName) {
      this.$refs[formName].validate(valid => {
        if (valid) {
          alert("submit!");
        } else {
          console.log("error submit!!");
          return false;
        }
      });
    },
    resetForm(formName) {
      this.$refs[formName].resetFields();
    },
    fetchData() {
      this.listLoading = true;
      getList().then(response => {
        this.list = response.data.items;
        this.listLoading = false;
      });
    },

    deleteh(item) {},

    stop(item) {}
  }
};
